- input: "TEXT\x1CC00013748\x1CX0\x1C\x1CF3XA\x1CThis amendment is in response to
    the Commission's letter dated November 14, 2008.  The excessive contribution from
    NODAK PAC was moved to the Committee's Non-Federal Account. The transfers to the
    Committee's Non-Federal account were for unitemized individual contributions from
    the Committee's May Monthly report that were intended to be deposited into a specific
